import React from 'react'
import { useNavigate } from 'react-router-dom'
const navigate = useNavigate();

function clickHandler(){
  navigate("./about");
}

const Labs = () => {
  return (
    <div>
      <div>Labs</div>
      <button onClick={clickHandler}>Move to about page</button>
    </div>
  )
}

export default Labs
